    false,nt"url": null,nt"notes": "In recent years considerable experimentation
    with the night-lighting technique for capturing waterfowl has been conducted in
    the United State s and Canada. Night-lighting may be defined as the Immobilization
    of animals at night with light and sound, and their subsequent capture, usually
    with nets. Experience demonstrates that this technique offers significant potential
    for the capture of waterfowl species usually difficult to obtain by ordinary trapping
    methods, or makes capture of birds possible in habitat not suited to conventional
